import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
function SideMenu() {

  return(
  
                <motion.div className='sidemenu'
                initial={{x:0}}
                animate={{x:0}}>
                <div className='sidemenu-'>
                    <div className='sidemenu-head'>
                    <img src="https://www.freepnglogos.com/uploads/chef-png/png-psd-download-chef-cook-vector-illustration-14.png" width="100" alt="png psd download chef cook vector illustration"></img>
                    <h3>Mr Chef</h3>
                    <h6>Since 1999</h6>
                    </div>
                    <ul className='sidemenu-body'>
                        <li>Home</li>
                        <li>About Us</li>
                        <li>Menu</li>
                        <li>Contact Us</li>
                    </ul>
                    <div className='sidemenu-footer'>
                        <h3>Also Check</h3>
                        <h2><Link to='/'>Le Muse cuisine</Link></h2>
                        <h6>To order delicious delicacies</h6>
                    </div>
                </div>
            </motion.div>
      )}


export default SideMenu;
